// SearchLogic.js
import React from 'react';

function SearchLogic({ searchText, data }) {
  const filteredData = data.filter(item =>
    item.title.toLowerCase().includes(searchText.toLowerCase())
  );

  return <>{filteredData}</>;
}

export default SearchLogic;
